import { useEffect } from 'react';
import { useDispatch } from 'react-redux';
import './App.css';
import { allGames } from './Redux/Actions';


function App() {
  const dispatch = useDispatch()

  useEffect(() => {
    dispatch(allGames)
  }, []);

  return (
    <>
      <Routes>
        <Route path='/' element={<Landing />} />
        <Route path='home' element={<Home />} />
      </Routes>
    </>
  );
}


export default App;
